import React  from 'react';
import Clock from 'react-live-clock';

function Index() {
    return (
        <React.Fragment>
            <Clock format={'HH:mm:ss'} ticking={true} timezone={'US/Pacific'} />
        </React.Fragment>
    )
}

export default Index
